import React from "react";

// If we want a child component to update or pass data to its parent, we can create a method inside the parent for the update
// Then bind the method to the parent, and pass it to the child as a prop

function CardBody(props) {
  return (
    <div className="card-body">
      <p className="card-text">Current Score: {props.count}</p>
      <button className="btn btn-primary" onClick={props.handleIncrement}>
          <img src="../assets/images/beth.png"/>
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
            "/../assets/images/birdperson.png"
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
          "/../assets/images/birdperson.png"
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
          ../assets/images/gianthead.png
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
            "/../assets/images/beth.png",
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
          ../assets/images/goldenford.png
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
            "../assets/images/jerry.png",
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
          ../assets/images/jessica.png
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
            "../assets/images/meeseeks.png"
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
          ../assets/images/morty.png
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
            "../assets/images/mr.png",
          </button>{" "}
          <button className="btn btn-primary" onClick={props.handleIncrement}>
          ../assets/images/rick.png
          </button>
    </div>

  );
}

export default CardBody;
